  false,\n\t\"url\": null,\n\t\"notes\": \"These data are a digital version of U.S.
  Geological Survey Professional Paper 1183, Landslide Overview Map of the Conterminous
  United States. The map and digital data delineate areas in the conterminous United
  States where large numbers of landslides have occurred and areas which are susceptible
  to landsliding. Because the data are highly generalized, owing to the small scale
  and the scarcity of precise landslide information for much of the country, they
  are unsuitable for local planning or actual site selection. This National Atlas
  map layer was previously distributed as Digital Representation of the Landslide
  Overview Map of the Conterminous United States.\",\n\t\"license_title\": null,\n\t\"extras\":
